import React from 'react';

import Stock from './Stock';

import './portfolio.css';


export default class portfolio extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            stockAmount: 5,
            stocks: [1, 2, 3, 4, 5]
        };
    }

    render(){
        return (
            <div>
                {this.state.stocks.map(stock => <Stock />)}
            </div>
        );
    }
}
